import React, { Component } from 'react';

class TimelineEvent extends Component {
  constructor(props) {
      super(props);
  }

  render() {
    return (
      <div className="event ">{this.props.event.type}
        Timeline event
      </div>
    )

  }
}

export default TimelineEvent;
